import React, {Component, Suspense} from 'react'
import { HashRouter, Route, Switch } from 'react-router-dom'
import styled from 'styled-components'
import { isMobile } from 'react-device-detect'

import Header from '../components/Header'
import Assets from './Assets'
import AssetsM from './AssetsM'
import DappM from './DappM'

const AppWrapper = styled.div`
  display: flex;
  flex-flow: column;
  justify-content: flex-start;
  align-items: stretch;
  min-height: 350px;
  overflow: auto;
`;

const BodyWrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
  align-items: center;

  flex: 1;
  overflow-y: auto;
  overflow-x: hidden;

  z-index: 1;
`;

class SearchComponent extends Component {
  constructor(props: any) {
    super(props);
    console.log(this.props);
  }
  render() {
    return (
        <div>aaaaaaaaaa</div>
    )
  }
}

export default function App(): React.ReactElement {

  return (
    <Suspense fallback={null}>
      <HashRouter>
        <AppWrapper>
          {!isMobile &&
            <Header />
          }
          <BodyWrapper>
            <Switch>
              <Route exact strict path="/" component={Assets} />
              <Route exact strict path="/assets" component={Assets} />
              <Route exact strict path="/assetsm" component={AssetsM} />
              <Route exact strict path="/dappm" component={DappM} />
              <Route exact strict path="/search" component={SearchComponent} />
            </Switch>
          </BodyWrapper>
        </AppWrapper>
      </HashRouter>
    </Suspense>
  );
}
